import React from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid } from '@material-ui/core';

import {
    Budget,
    LatestOrders,
    LatestProducts,
    LatestSales,
    SharedPublically,
    TasksProgress,
    TotalUsers,
    UploadCard
} from './components';

const useStyles = makeStyles(theme => ({
    root: {
        padding: theme.spacing(4)
    }
}));

const Dashboard = () => {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid
                container
                spacing={4}
            >
                <Grid
                    item
                    lg={3}
                    sm={3}
                    xl={3}
                    xs={6}
                >
                    <UploadCard/>
                </Grid>
                <Grid
                    item
                    lg={3}
                    sm={3}
                    xl={3}
                    xs={6}
                >
                    <TotalUsers/>
                </Grid>
                <Grid
                    item
                    lg={3}
                    sm={3}
                    xl={3}
                    xs={6}
                >
                    <TasksProgress/>
                </Grid>
                <Grid
                    item
                    lg={3}
                    sm={3}
                    xl={3}
                    xs={6}
                >
                    <Budget/>
                </Grid>
                <Grid
                    item
                    lg={6}
                    md={8}
                    xl={6}
                    xs={12}
                >
                    <LatestSales/>
                </Grid>
                <Grid
                    item
                    lg={6}
                    md={8}
                    xl={6}
                    xs={12}
                >
                    <LatestOrders/>
                </Grid>

                <Grid
                    item
                    lg={6}
                    md={8}
                    xl={6}
                    xs={12}
                >
                    <LatestProducts/>
                </Grid>
                <Grid
                    item
                    lg={6}
                    md={8}
                    xl={6}
                    xs={12}
                >
                    <SharedPublically/>
                </Grid>
            </Grid>


        </div>
    );
};

export default Dashboard;
